import "./topbar.scss";
import { Person, Mail } from "@material-ui/icons";

function Topbar() {
  return (
    <div className="topbar">
      <div className="wrapper">
        <div className="left">
          <a href="#intro" className="logo">
            SK
          </a>
          <div className="itemContainer">
            <Person />
          </div>
        </div>
        <div className="right"> This is right</div>
      </div>
    </div>
  );
}

export default Topbar;
